import React from "react";

function ProfilePage() {
  return (
    <div style={{ padding: "20px", fontFamily: "Arial" }}>
      <h1>Profile Page</h1>
      <p>This is the user profile page.</p>
    </div>
  );
}

export default ProfilePage;
